X=""
X="01010100 01101000 01100101 01111001 00100000 01110011 01100101 01100101 00100000 01100101 01110110 01100101 01110010 01111001 00100000 01101101 01101111 01110110 01100101 00100000 01111001 01101111 01110101 00100000 01101101 01100001 01101011 01100101 00101110 00100000 01001001 00100111 01101101 00100000 01101110 01101111 01110100 00100000 01110011 01110101 01110010 01100101 00100000 01101001 01100110 00100000 01101001 01110100 00100000 01100011 01101111 01110101 01101100 01100100 00100000 01100010 01100101 00100000 01101000 01100101 01101100 01100100 00100000 01100001 01100111 01100001 01101001 01101110 01110011 01110100 00100000 01111001 01101111 01110101 00101110 00100000"
X=X.replace(" ","") # no spaces allowed
assert len(X)%8==0,"Error Message: binary string is not an even multiple of 8, requires byte 0 padding"
for index in range(len(X)):
	if index+1==8: # first byte
		print(chr(int(X[:index+1], 2)),end='')
	elif (index+1)%8==0:
		print(chr(int(X[index-7:index+1], 2)),end='')
print()
